import {useState} from 'react';

const Exercises = ({Exercises, handleDelete}) => {

    return(
        <div>
            <h1> Exercises </h1>
        { Exercises.map((Exercise) => (
            <div className = "exercise-details" key={Exercise.id}>
                <h2> <img src={Exercise.photo}/> {Exercise.name} <span className="reps"> Reps: {Exercise.reprange}</span></h2>
                <button onClick= {() => handleDelete(Exercise.id)}> Exercise disappears</button>
            </div>
        )
        )}
        </div>
    );
}
export default Exercises;
